CREATE TABLE `doors` (
  `ID` int(11) NOT NULL,
  `X` float NOT NULL,
  `Y` float NOT NULL,
  `Z` float NOT NULL,
  `HZ` float NOT NULL,
  `playfield` int(10) unsigned NOT NULL,
  `toplayfield` int(10) unsigned NOT NULL,
  `toid` int(11) NOT NULL,
  `proxy` tinyint(1) NOT NULL DEFAULT '0',
  `HX` float NOT NULL,
  `HY` float NOT NULL,
  `HW` float NOT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

